// https://leetcode.com/problems/subarrays-with-k-different-integers/

/**
 * @param {number[]} A
 * @param {number} K
 * @return {number}
 */
const subarraysWithKDistinct_naive = (A, K) => {
    let good = [];
    let distinctArr = new Set(A);
    if (distinctArr.size < K) {
        return 0;
    }
    
    for (let i = 0; i < A.length - K + 1; i++) {
        // check from the current index, to see if there are enough distinct integers.
        let current = A[i];
        let j = i;
        let found = A.slice(i, j+1);
        while (j < A.length && found.length <= K) {
            if (found.indexOf(A[j]) < 0) {
                found.push(A[j]);
            }
            if (found.length === K) {
                good.push(A.slice(i, j+1));
            }
            j++;
        }
        
    }
    return good.length;
};

/**
 * Implementation of the Solution Provided
 */

/**
 * Window class for the sliding window to keep track the unique value
 */
class Window {
    constructor () {
        this.nonzero  = 0;
        this.count = {};
    }
    add(x) {
        this.count[x] = this.count.hasOwnProperty(x) ? this.count[x] + 1 : 1;
        if (this.count[x] == 1) {
            this.nonzero++;
        }
            
    }
    remove(x) {
        this.count[x] = this.count.hasOwnProperty(x) ? this.count[x] - 1 : 0;
        if (this.count[x] == 0) {
            this.nonzero--;
        }
    }
    
    get diff() {
        return this.nonzero;
    }
};

const subarraysWithKDistinct = (A, K) => {
    let win1 = new Window();
    let win2 = new Window();
    let ans = 0;
    let left1 = 0;
    let left2 = 0;
    
    for (let i = 0; i < A.length; ++i){
        let x = A[i];
        win1.add(x);
        win2.add(x);

        // update window that contains more than K elements.
        while (win1.diff > K) {
            win1.remove(A[left1++]);
        }

        // update window that contains unique K elements.
        while (win2.diff >=K) {
            win2.remove(A[left2++])
        }

        // When added a new x, we try to find the exact match left2 that is exactly K elelement.
        // And left1 is the window that lager than K element.

        // Here are some possible combinations of the left2 and left1:
        // Case (1): if left2 == left1 == 0:
        //     means when a new x is added, the unique elements number is smaller than K.
        // Case (2): if left2 == left1, and left2 or left1 > 0:
        //     This may not happen, because when there is any matching found, 
        //     left2 will always > left1
        // Case (3): if left2 > left1 >= 0:
        //     We move the win2, then move the win1, the diff between them are the 
        //     Solution we found when adding new x.
        // 
        // left2 and left1 are monotone increasing.
        // left2 are the new valid solutions, 
        // left1 are the previous valid solution.
        // So when added a new x, we can just compare the difference between left2 and left1, 
        // That will be the answer we need.

        ans += left2 - left1;
    }
    return ans;
};

console.assert(subarraysWithKDistinct([1,2,1,2,3], 2) == 7);

console.assert(subarraysWithKDistinct([1,2,1,3,4], 3) == 3);

